import React from "react";

function Contact() {
  return (
    <div className="contact py-5">
      <form>
      <h2 className="pt-5 pb-2">Lets Discuss Something Intresting !!!!</h2>
        <div className="row mb-3">
          <div className="col-7-lg col-md-12 col-sm-12">
            <input type="email" className="form-control mb-3" id="" placeholder="Email"/>
            <textarea className="form-control" id="" placeholder="Comment" rows={7}></textarea>
          </div>
        </div>
        <button type="submit" className="btn border-bottom-5">
          Connect with Ayaan Malik
        </button>
      </form>
    </div>
  );
}

export default Contact;
